%[text] # Convolucion y propiedades
%%
%[text] ## Operaciones de convolucion
%[text] ![](text:image:39d7)
%1
h = [1,2,1];
x = [1,2,3,4,5];

y = conv(x,h);

x_lim = [-1 10];

figure %[output:0585578d]
subplot(3,1,1) %[output:0585578d]
stem(x) %[output:0585578d]
xlim(x_lim) %[output:0585578d]
legend("x[n]") %[output:0585578d]
subplot(3,1,2) %[output:0585578d]
stem(h) %[output:0585578d]
xlim(x_lim) %[output:0585578d]
legend("h[n]") %[output:0585578d]
subplot(3,1,3) %[output:0585578d]
stem(y) %[output:0585578d]
xlim(x_lim) %[output:0585578d]
legend("y[n]") %[output:0585578d]


%2
clear
syms t

%x_lim = [-1 10];
n = -40:40;
x_lim = [min(n) max(n)];
h = t*(heaviside(t+5)-heaviside(t-5));
h = subs(h,t,n);
x = heaviside(t-10)- heaviside(t-20);
x = subs(x,t,n);

y = conv(double(x),double(h));

%Cuadrar bien el n_y
%n_y = [-5+10:5+20];

figure %[output:5a4f2d32]
subplot(3,1,1) %[output:5a4f2d32]
stem(n,x) %[output:5a4f2d32]
xlim(x_lim) %[output:5a4f2d32]
legend("x[n]") %[output:5a4f2d32]
subplot(3,1,2) %[output:5a4f2d32]
stem(n,h) %[output:5a4f2d32]
xlim(x_lim) %[output:5a4f2d32]
legend("h[n]") %[output:5a4f2d32]
subplot(3,1,3) %[output:5a4f2d32]
%Por terminar
stem(y) %[output:5a4f2d32]
%xlim(x_lim)
legend("y[n]") %[output:5a4f2d32]
%[text] ![](text:image:40bc)
%[text] ![](text:image:23e5)
%[text] Usar definicion de la integral convolutiva y variables simbolicas
% 1
clear
syms t tau

x = heaviside(t-1)-heaviside(t-2);
h = x;
%[text] ![](text:image:010e)
%Definición de convolucion
%[text] ![](text:image:0298)
y = int(subs(x,t,tau)*subs(h,t,t-tau),tau,-inf,inf) %[output:38944b13]

x_lim = [0 10];
y_lim = [-0.5 1.2];

figure %[output:062b89b1]
subplot(3,1,1) %[output:062b89b1]
fplot(x) %[output:062b89b1]
xlim(x_lim) %[output:062b89b1]
ylim(y_lim) %[output:062b89b1]
legend("x(t)") %[output:062b89b1]
subplot(3,1,2) %[output:062b89b1]
fplot(h) %[output:062b89b1]
xlim(x_lim) %[output:062b89b1]
ylim(y_lim) %[output:062b89b1]
legend("h(t)") %[output:062b89b1]
subplot(3,1,3) %[output:062b89b1]
fplot(y) %[output:062b89b1]
xlim(x_lim) %[output:062b89b1]
ylim(y_lim) %[output:062b89b1]
legend("y(t)") %[output:062b89b1]


%%
%[text] ## Propiedades
%[text] ![](text:image:62c9)
%[text] ![](text:image:54f7)
% En honor a Rodrigo, porque lo intentó
% 1
clear

syms t tau

h1 = heaviside(t)-heaviside(t-5);
h2 = 2*exp(-2*t)*(heaviside(t)-heaviside(t-5));

h1h2 = int(subs(h1,t,tau)*subs(h2,t,t-tau),tau,-inf,inf);
h2h1 = int(subs(h2,t,tau)*subs(h1,t,t-tau),tau,-inf,inf);


x_lim = [-2 10]; y_lim = [-1 2];

figure %[output:91863909]
subplot(3,1,1) %[output:91863909]
fplot(h1,x_lim) %[output:91863909]
ylim(y_lim) %[output:91863909]
legend("h_1(t)") %[output:91863909]
subplot(3,1,2) %[output:91863909]
fplot(h2,x_lim) %[output:91863909]
ylim(y_lim) %[output:91863909]
legend("h_2(t)") %[output:91863909]
subplot(3,1,3) %[output:91863909]
fplot(h1h2,x_lim) %[output:91863909]
hold on %[output:91863909]
fplot(h2h1,x_lim,'r--') %[output:91863909]
ylim(y_lim) %[output:91863909]
legend("h_1*h_2(t)","h_2*h_1(t)") %[output:91863909]

%2
clear

syms t tau

h1 = (1/pi)*t*(heaviside(t)-heaviside(t-5));
h2 = 2*exp(-2*t)*(heaviside(t)-heaviside(t-5));
x = heaviside(t)-heaviside(t-5);

% (x*h1)*h2
xh1 = int(subs(x,t,tau)*subs(h1,t,t-tau),tau,-inf,inf);
xh1h2 = int(subs(xh1,t,tau)*subs(h2,t,t-tau),tau,-inf,inf);

% x*(h1*h2)
h1h2 = int(subs(h1,t,tau)*subs(h2,t,t-tau),tau,-inf,inf);
h1h2x = int(subs(h1h2,t,tau)*subs(x,t,t-tau),tau,-inf,inf);

x_lim = [-2 20]; y_lim = [-1 10];
figure %[output:19970039]
subplot(4,1,1) %[output:19970039]
fplot(x,x_lim) %[output:19970039]
ylim(y_lim) %[output:19970039]
legend("x(t)") %[output:19970039]
subplot(4,1,2) %[output:19970039]
fplot(h1,x_lim) %[output:19970039]
ylim(y_lim) %[output:19970039]
legend("h_1(t)") %[output:19970039]
subplot(4,1,3) %[output:19970039]
fplot(h2,x_lim) %[output:19970039]
ylim(y_lim) %[output:19970039]
legend("h_2(t)") %[output:19970039]
subplot(4,1,4) %[output:19970039]
fplot(xh1h2,x_lim) %[output:19970039]
hold on %[output:19970039]
fplot(h1h2x,x_lim,'r--') %[output:19970039]
ylim(y_lim) %[output:19970039]
legend("(x*h_1)*h_2","x*(h_1*h_2)") %[output:19970039]
